Clad in wild panther prints, Aletta Ocean wears her clothes according to her true nature: she is indeed a wild animal, on the hunt for fresh man-meat! It might not be easy to tame her, but if you'd like to test yourself, here's your chance... But prepare, it's not easy to handle this she-panther!
